import React from 'react';
import { Navbar, Nav, Form, FormControl, Button, ListGroup} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Navigation() {
return(
    
    <div className="Navigation">
        <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">ARCHIVE_SNS</Navbar.Brand>
    <Nav className="mr-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#features">user_contorl</Nav.Link>

        <ListGroup>
            <ListGroup.Item>로그인</ListGroup.Item>
            <ListGroup.Item>회원가입</ListGroup.Item>
            <ListGroup.Item>Morbi leo risus</ListGroup.Item>
        </ListGroup>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="내용을 입력하세요" className="mr-sm-2" />
      <Button variant="outline-info">검색</Button>
    </Form>
 </Navbar>
			
    </div>
);
}
    export default Navigation;
